function s(){const n="previousTabId",o=document.querySelectorAll('[fs-anchor-element="tab"]');if(o.length===0)return;const a=sessionStorage.getItem(n);o.forEach(e=>{const t=e.getAttribute("data-w-tab");if(a===t){const c=new CustomEvent("click");e.dispatchEvent(c)}e.addEventListener("click",()=>{t&&sessionStorage.setItem(n,t)})})}document.addEventListener("DOMContentLoaded",()=>{window.Webflow&&window.Webflow.push?window.Webflow.push(s):document.addEventListener("readystatechange",()=>{document.readyState==="complete"&&s()})});
